import React, { Component } from 'react';
import {
  Button,
  Form,
  FormGroup,
  FormControl,
  ControlLabel } from 'react-bootstrap';

import ReactDOM from 'react-dom';
import { getMaxListeners } from 'cluster';
import {  Redirect  } from 'react-router-dom';

const request = require('request');
const sha256 = require('sha256');
import "../basics.css";

import Footer from "./Footer";

export default class Auth extends Component {

    constructor (props){
        super (props);

        this.state = {
            email: "",
            username: "",
            password: "",
            password_confirm: "",
            isRegistered: true,
            isAuthenticated: false
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleLoginSubmit = this.handleLoginSubmit.bind(this);
        this.handleRegisterSubmit = this.handleRegisterSubmit.bind(this);

    }

    validateForm() {
        return this.state.username.length > 0 && this.state.password.length > 0;
    }

    handleChange(event) {
      this.setState({[event.target.name]: event.target.value});

        console.log(this.state.password);
    }

    handleLoginSubmit = (event) =>{
        const pHash = "bec5fb6c64e77dc03b2677671222125769ed383ed9ca6806cfaf306dcf0d9c1e"
        if(this.state.username === "admin" && sha256(this.state.password) === pHash){
            // this.authenticateExisting(this.state.username, this.state.password);
            event.preventDefault();
            alert('Sorted.\n Taking you to the admin panel...');
            this.setState({isAuthenticated: true});
        }
        else{
          alert('Wrong creds!')
        }
    }

    handleRegisterSubmit = (event) =>{

        alert('username:', this.state.username, 'passHash', sha256(this.state.password));
        if(this.state.password === this.state.password_confirm){
        // this.authenticateNew(this.state.email, this.state.username, this.state.password);
        event.preventDefault();
        }
        else {
            alert("Passwords do not match!");
        }
    }

    resetState = (event) =>{
        this.setState({
        email: "",
        username: "",
        password: "",
        password_confirm: "",
        });

    }

    toggleIsRegistered = () => {
        this.setState({
            isRegistered: !this.state.isRegistered
        });

    }

    // authenticateExisting = (username,password) => {
    //     const options = {
    //         method: 'POST',
    //         url:'http://127.0.0.1:3838/auth_existing',
    //         headers:
    //         {
    //         "Content-Type": 'application/json'
    //         },
    //         body: {
    //             'username': username,
    //             'password256': sha256(password)
    //         },
    //         json: true
    //     };
    //
    //     request(options, (error, response, body) => {
    //         console.log("Successfully sent request!");
    //         if(error){
    //             console.error(new Error(error));
    //             return;
    //         }
    //         alert(body.message);
    //         console.log(body.message);
    //
    //     });
    //
    // }
    //
    // authenticateNew = (email,username,password) =>{
    //
    //     console.log("password is correct");
    //
    //     const options = {
    //         method: 'POST',
    //         url:'http://127.0.0.1:3838/auth_new',
    //         headers:
    //         {
    //         "Content-Type": 'application/json'
    //         },
    //         body: {
    //             'email': email,
    //             'username': username,
    //             'password256': sha256(password)
    //         },
    //         json: true
    //         };
    //
    //     request(options, (error, response, body) => {
    //         console.log("Successfully sent request!");
    //         if(error){
    //             console.error(new Error(error));
    //             return;
    //         }
    //         alert(body.message);
    //         console.log(body.message);
    //
    //     });
    // }

    render(){
        if(this.state.isAuthenticated){
          return <Redirect to='/admin'/>;
        }
//use the Form.Group controlId as reference to this.state.username/password -> see handleChange()
        let userauth= this.state.isRegistered ?
        (
          <div>
            <div className="Auth container" >
              <div className="col-lg-3 col_centered" style={{padding: "1%"}}>

                <input name='username' type="username" style={{background:"transparent"}} class="form-control form-control-lg text_center" id="username" placeholder="Enter username" onChange={event => this.handleChange(event)} />
                <br />
                <input name='password' type="password" style={{background:"transparent"}} class="form-control form-control-lg text_center" id="password" placeholder="Enter password" onChange={event => this.handleChange(event)} />
                <br />
                <div style={{display: "flex", alignItems: "center",justifyContent:"center"}}>

                <button class="btn btn-lg outline-primary" type="submit" onClick={this.handleLoginSubmit}>
                Login
                </button>
                </div>
                <hr />
                <div style={{display: "flex", alignItems: "center",justifyContent:"center"}}>
                <Form.Text> Not registered?</Form.Text>
                </div>
                <br />
                <div style={{textAlign: "center",display: "flex", alignItems: "center",justifyContent:"center"}}>
                <Button variant="primary" type="button" onClick={this.resetState, this.toggleIsRegistered}>
                    Sign-up
                </Button>
                </div>
                <hr />

              </div>
            </div>

            <Footer />
          </div>
        ) :
        (
          <div>
            <div className="Auth container">
              <div className="col-lg-4 col_centered">
              <Form onSubmit={this.handleRegisterSubmit}>

                  <input name='email' type="email" style={{background:"transparent"}} class="form-control form-control-lg text_center" id="exampleAmount" placeholder="Enter email" onChange={event => this.handleChange} />
                  <br />
                  <input name='username' type="username" style={{background:"transparent"}} class="form-control form-control-lg text_center" id="exampleAmount" placeholder="Select username" onChange={event => this.handleChange} />
                  <br />
                  <input name='password' type="password" style={{background:"transparent"}} class="form-control form-control-lg text_center" id="exampleAmount" placeholder="Choose password" onChange={event => this.handleChange} />
                  <br />
                  <input name='password' type="password" style={{background:"transparent"}} class="form-control form-control-lg text_center" id="exampleAmount" placeholder="Confirm password" onChange={event => this.handleChange} />
                  <br />

                  <div style={{display: "flex", alignItems: "center",justifyContent:"center"}}>
                  <Button variant="outline-primary" type="submit" size='lg'>
                      Register
                  </Button>
                  </div>
                  <hr />
                  <div style={{textAlign: "center",display: "flex", alignItems: "center",justifyContent:"center"}}>
                  <Form.Text> Already Registered?</Form.Text>
                  </div>
                  <br />

                  <div style={{textAlign: "center",display: "flex", alignItems: "center",justifyContent:"center"}}>
                  <Button className="blue_back" variant="primary" type="submit" onClick={this.resetState, this.toggleIsRegistered}>
                     Login
                  </Button>
                  </div>
                  <hr />
              </Form>
              </div>
            </div>

            <Footer />
          </div>
        );

        return (
            <div className='svg_backs_sun'>
            <br />
            <h2 style={{textAlign: "center"}}>Authentication</h2>
            <hr />
            {userauth}
            </div>
        );
    }
}
